import React from "react";
import {SidebarLeftData} from "./SidebarLeftData"
import "./sidebarLeft.css";
function LeftSidebar(){
    return(
        <>
            <div className="sidebarLeft">
                <ul className="sidebarLeftList">
                    {SidebarLeftData.map((val, key) => {
                        return <li className="rowLeft"
                                   key = {key} onClick={() => {window.location.pathname = val.link}}>
                            {" "}
                            <div >{val.title}</div>
                        </li>;
                    })}
                </ul>
            </div>
            <div className="sidebarLeft">
                <ul className="sidebarLeftList">
                    {SidebarLeftData.map((val, key) => {
                        return <li className="rowLeft"
                                   key = {key} onClick={() => {window.location.pathname = val.link}}>
                            {" "}
                            <div >{val.title}</div>
                        </li>;
                    })}
                </ul>
            </div>
        </>
    )
}

export default LeftSidebar
